goog.dom.selection.useSelectionProperties_ = function(el) {
  'use strict';
  try {
    return typeof el.selectionStart == 'number';
  } catch (e) {
    // Firefox throws an exception if you try to access selectionStart
    // on an element with display: none.
    return false;
  }
};

