  return goog.string.unescapeEntities(goog.string.trim(
      value
          .replace(
              goog.html.utils.HTML_TAG_REGEX_,
              function(fullMatch, tagName) {
                'use strict';
                return goog.html.utils.INLINE_HTML_TAG_REGEX_.test(tagName) ?
                    '' :
                    ' ';
              })
          .replace(/[\t\n ]+/g, ' ')));
