  var buttonElement = this.getButtonElement();

  // NOTE: Unlike goog.ui.MenuButton, using TOP_START/END as anchor corners.
  var buttonCorner =
      this.isAlignMenuToStart() ? Corner.TOP_START : Corner.TOP_END;

  var menuEl = this.getMenu().getElement();
